import React from 'react';
import data from './data';
import './App.css';

function Title() {
  return(
    <div className="title">
      <h1>Emily Giurleo</h1>
      <div className="social">
          data.social.map(social => (
            <a href={social.link} alt={social.name}>
              {social.svg}
            </a>
          )
      </div>
    </div>
  );
}

export default Title;
